import { GridList } from "@material-ui/core";
import { React } from "react";
import { Item } from "../../components/cart-item/item.css"
import { Constants } from "../../Constants";
export default class UserProgress extends React.Component {

    state = {
        orders: Constants.getToLocalStorage(Constants.ORDER)
    }

    render() {
        return (
            <div className="onprogress-container">
                <GridList cols={3} cellHeight={250} style={{ height: 'auto' }} >
                    {
                        this.state.orders.map(order =>
                            <ul key={order.id}>
                                <Item key={order.id} productData={order} />
                            </ul>
                        )
                    }
                </GridList>
            </div>
        );
    }
}
